import React from 'react'
import Logo from "../img/logo.png"

const Navbar = () => {
  return (
    <div className='navbar'>
      <div className="container">
        <div className="logo">logo</div>
        <div className="links">links</div>
      </div>
    </div>
  )
}

export default Navbar
